import React, { Fragment } from "react";
import "./styles.css";
import { Parallax, Background } from 'react-parallax';
import { Container, Row, Col, Media, Label, Badge, ListGroup, ListGroupItem, Card, CardBody, CardHeader } from 'reactstrap';

// background-parallax-vpn-setup

const DownloadSetupCoreVPNDataInformationHelper = (props) => {
    return (
        <Fragment>
            <Parallax
                className={"background-parallax-vpn-setup-img"} 
                bgImage={require('../../../../assets/images/anon.jpg')}
                renderLayer={percentage => {
                    const calculated = (percentage / 9.25) * (percentage * 5.25);
                    console.log("percentage", percentage, calculated);
                    return (
                        <div
                            style={{
                                position: 'absolute',
                                background: `rgba(${calculated}, 102, 255, ${calculated - 0.275})`,
                                minHeight: "540px",
                                maxHeight: "540px",
                                left: '0px',
                                top: '0px',
                                right: "0px",
                                width: "100%",
                                height: "100%",
                            }}
                        >
                            <Card className={"vpn-setup-card-parallax"}>
                                <CardBody className={"vpn-inner-cardbody"}>
                                    <CardHeader className={"b-l-primary border-3 vpn-setup-card-header"}>
                                        <h1 className={"vpn-parallax-header-text"}>You're on the "Setup your VPN" page which will allow you to setup your personal FREE VPN!</h1>
                                    </CardHeader>
                                    <CardBody className={"cardbody-vpn-setup"}>
                                        <p className={"vpn-parallax-sub-text"}>You will be given a certain amount of credits to use on our FREE VPN (a reasonable amount of credit's) to use our VPN as your own PRIVATE NETWORK (more privacy) once everything is properly setup & running. We highly recommend testing your network...</p>
                                    </CardBody>
                                </CardBody>
                            </Card>
                        </div>
                    );
                }}
            />
            <Container fluid={true}>
                <Row>
                    <Col sm="12" md="12" lg="12" xl="12">
                        <Card className={"vpn-setup-card-page-one"}>
                            <CardHeader>
                                <h1>hello.</h1>
                            </CardHeader>
                            <CardBody>

                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}
export default DownloadSetupCoreVPNDataInformationHelper;
